import React from "react";
import Product from "../components/Product";
import { Container, Row, Col } from "react-bootstrap";

const ProductsListScreen = () => {
  const list_of_prods = [
    {
      name: "Carrot",
      price: "20 cedis",
      weight: "10kg",
      category: "vegetable",
    },
    {
      name: "yam",
      price: "20 cedis",
      weight: "10kg",
      category: "tuber",
    },
    {
      name: " Name : rice",
      price: "  Price: 20 cedis",
      weight: " Weight: 10kg",
      category: "cereal",
    },
    {
      name: "pawpaw",
      price: "20 cedis",
      weight: "10kg",
      category: "fruit",
    },
    {
      name: "okro",

    }
  ];

  return (
    <div>
      <h1>List of product</h1>
      <Container>
        all | vegetable | cereal | fruit | | agro-chemicals
        <Row>
          {list_of_prods.map((prod) => {
            return (
              <Col sm={12} md={6} lg={4} xl={3}>
                <Product
                  name={prod.name}
                  price={prod.price}
                  wieght={prod.weight}
                  category={prod.category}
                />
              </Col>
            );
          })}
        </Row>
      </Container>
    </div>
  );
};

export default ProductsListScreen;
